import React, { Component } from 'react';

class Links extends Component {
  render() {

    return(
    <div className="animated fadeIn">
      <h3>-- CODE --</h3>
      <p><a href="https://github.com/sburbd">Sburbd on Github</a></p>
      <h3>-- TWITTER --</h3>
      <p><a href="https://twitter.com/zilchbot">Main Twitter</a></p>
      <p><a href="https://twitter.com/zichey">Art reblog Twitter</a></p>
      <h3>-- DISCORD --</h3>
      <p>Add me: <b>zich#2806</b></p>
      <p><a href="https://discord.gg/7banpbj">HS JP/KOR study discord</a></p>

    </div>
    )
  }
}

export default Links;
